    [],nt"revision_timestamp": "2016-07-19T05:40:24.624928",nt"name": "database-of-interacting-proteins-dip",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The DIP database catalogs experimentally
    determined interactions between proteins. It combines information from a variety
    of sources to create a single, consistent set of protein-protein interactions. The
    data stored within the DIP database are curated both manually by expert curators
    and also automatically using computational approaches that utilize the the knowledge
    about the protein-protein interaction networks extracted from the most reliable,
    core subset of the DIP data.</p>n",nt"license_title": "Other License Specified",nt"extras":
